import {Movies} from '../components/Movies'

function Main(props) {
    return <main className="content container">
        Hello from React movies-project
        <Movies 
        movies={props.search}
        id={props.imdbID}
        Type={props.type}
        Title={props.title}
        Year={props.year}
        Poster={props.poster}
        />
    </main>
}

export {Main}
